function addDropdownItems(optionsF) {
  // create DOM element to add to dropdown
  var languageDropdown = document.getElementById("languageDropdown");
  
  for(option of optionsF) {
	// add options to dropdown
	var el4 = document.createElement("option");	
		el4.textContent = option[1].charAt(0).toUpperCase() + option[1].slice(1);
		el4.value = option[0];
			
		languageDropdown.appendChild(el4);
  };
};

// get name from id
function getClearName(rawName){
    var clearName = rawName.split("_")[1]
	
	if (clearName) {
		if (!clearName.slice(-1).isNaN){
			clearName = clearName.slice(0,-8) + " " + clearName.slice(-8)
		};
	}
	
    return clearName
};

// get all language families from data array and add them to the dropdown list
function populateDropdown(){
    let optionList = [];
	for (const [key, value] of Object.entries(data2)) {
	  if (key) {
	  console.log(key)
	  optionList.push([key, key, value["family"]]);
	  }
	}

	optionList.sort(function(a,b){return a[1].localeCompare(b[1]);}); // sort alphabetically
	addDropdownItems(optionList)		
};

function makeNode(node){
  var nodeA = {
	  group: node[0],
	  id: node[1],
	  label: node[2],
	  title: node[2],
	  value: 1000
  };
  return nodeA
}

function makeEdge(edge) {
	var edgeA = {
		  from: edge[0],
		  to: edge[1],
		  width: edge[2]
		};

  return edgeA
}

// put notes and edges on the canvas
function redrawAll() {

  var selectLanguage = document.getElementById("languageDropdown").value;
  var nodes = []
  var edges = []
  
  // create nodes
  for (node of data2[selectLanguage]["nodes"]) {   
    nodes.push(makeNode(node))
  };

  // create edges 
  for (edge of data2[selectLanguage]["edges"]) {
    edges.push(makeEdge(edge))
  };
   
  // create a network
  var container = document.getElementById("mynetwork");
  
  // remove positoins
  for (var i = 0; i < nodes.length; i++) {
    delete nodes[i].x;
    delete nodes[i].y;
  };

  // create a network
  var data = {
    nodes: nodes,
    edges: edges, 
  };
  
  var moveToOptions = {
    // makes it zoom out after loading
    scale: 0.13,              // scale to animate to  (Number)
    animation: {             // animation object, can also be Boolean
      duration: 2000,                 // animation duration in milliseconds (Number)
      easingFunction: "easeOutQuad" // Animation easing function, available are:
    }                                   // linear, easeInQuad, easeOutQuad, easeInOutQuad,
  } 

  var options = {
    
    //autoResize: true,
    nodes: {
      shape: "dot",
      font: {
        size: 98,
        face: "Tahoma",
      },
    },
    edges: {
      color: { inherit: "from" },
      smooth: {
        type: "continuous",
      },
    },
    physics: {
      stabilization: false,
      barnesHut: {
        gravitationalConstant: -10000,
        springConstant: 0.001,
        springLength: 300,
      },
    },
    interaction: {
      tooltipDelay: 200,
      hideEdgesOnDrag: true,
    },
  };

  // 
  network = new vis.Network(container, data, options);
 
  network.moveTo(moveToOptions)
};
</script>
